import Link from "next/link";

const PodcastList = ({ audioClips, setOpenPodcast }) => {
  return (
    audioClips.map( clip => (
      <Link href={`/podcast/podcast`} as={`/podcast/${clip.id}`} onClick={e => setOpenPodcast(e, clip)}>
        <a > { clip.title } </a>
      </Link>
    ))
  )
}

export default PodcastList;
